import { Card, CardContent, Container, Grid, Paper } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      <Container>
        <Card Container>
          {card.map((e, i) => (
            <Card item key={i} sx={{ m: 5, height: '75px' }}>
              <img
                src={imag4}
                alt=''
                style={{ width: '100px', height: '100px' }}
              />
              <p>{e.title}</p>
            </Card>
          ))}
        </Card>
      </Container>
    </>
  )
}
